const InitRoutes = () => {
  return (
    <Routes>
      <Route path="/" element={<Welcome />}></Route>
      <Route path="/login">
        <Route index element={<Login />} />
        <Route path="forgotPassword" element={<Forgotten />} />
      </Route>
      <Route path="/register" element={<Signup />} />
      <Route path="/home/*" element={<Home></Home>}></Route>
    </Routes>
  );
};

export default InitRoutes;
